  `job_intention` text COMMENT '求职意向',
  `work_experience` text COMMENT '工作经历',
  `evaluation` varchar(255) DEFAULT NULL COMMENT '自我评价',
  `other` text COMMENT '其他说明',
  `created_at` int(11) DEFAULT NULL,
  `updated_at` int(11) DEFAULT NULL,
