  `current_post` varchar(100) DEFAULT NULL COMMENT '职位名称',
  `exchange` varchar(50) DEFAULT NULL COMMENT '沟通要点（经验、英文、薪酬地址）',
  `wechat_id` varchar(50) DEFAULT NULL COMMENT '微信号',
